		body {
			background-color: white;
			color: darkblue;
			margin: 0px;
			padding: 0px;
			display: flex;
		}

		:link {
			color:darkblue;
		}
		section {
			display: flex;
			flex-flow: row nowrap;
			width: 100%;
			height: 100vh;
			padding: 0px;
			margin: 0px;
			justify-content: space-between;
		}

		article {
			display: flex;
			border: none;
			width: 50%;
			height: 100%;
			padding: 0px;
			margin: 0px;
			overflow: hidden;
			border-left: 1px solid lightgrey;
		}

		 svg text{
		  text-anchor: middle;
		  dominant-baseline: middle;
		}

		@media screen and (max-width: 800px) {
			body {
				flex-direction: column;
				width: 100%;
			}

			section {
				border-left: none;
				flex-direction: column;
				width: 100%;
			}

			article {
				border-top: 1px solid lightgrey;
				border-left: none;
				width: 100%;
			}

		}

		.selected {
			font-style: italic;
		    border-top : 1px solid darkblue;
		    border-bottom : 1px solid darkblue;
		}

		.info a {
			font-size: 1.5em;
		    padding: 0px;
		    margin: 0px;
		    text-decoration: none;
			cursor: pointer;
			font-style: italic;
		}


    </style>
    <script>
        function pause(svg) {
            if (svg.animationsPaused()) {
                svg.unpauseAnimations();
            } else {
                svg.pauseAnimations();
            }
        }
    </script>
